import React from 'react'
import { Link, useParams } from 'react-router-dom'

const ListItem = ({book}) => {
    return (
        <Link to={`/book/${book.id}`} style={{ textDecoration: 'none', color: 'inherit'}}>
        <div className='book-list-item'>{book.title}</div>
        </Link>
    )
}

export default ListItem
